import Link from "next/link";
import { MenuList, Menu } from "@material-ui/core";

const Navbar = () => {
  return (
    <ul>
      <li>
        <Link href="/">
          <button>Home</button>
        </Link>
      </li>
      <li>
        <Link href="/about">
          <button>About</button>
        </Link>
      </li>
    </ul>
  );
};

export default Navbar;
